    "text" : "\uD55C\uD3B8 \uB098\uB294 \uC8FC\uBCC0\uC5D0 \uD65C\uB3D9\uAC00 \uCE5C\uAD6C\uAC00 \uB9CE\uC9C0\uB9CC, \uADF8\uB807\uC9C0 \uC54A\uC740 \uACBD\uC6B0\uC5D4 \uC5B5\uC6B8\uD558\uAC8C \uB2F9\uD558\uB294 \uC77C\uB3C4 \uB9CE\uACA0\uB2E4 \uC0DD\uAC01\uD588\uB2E4. \uADF8\uB4E4\uC740 \uB0B4 \uCE5C\uAD6C\uACE0, \uB098\uB97C \uC798 \uB3C4\uC640\uC904 \uAC83\uC774\uB2E4. \uD558\uC9C0\uB9CC \uADF8\uB4E4\uC740 \uB0B4\uAC00 \uC544\uB2CC \uB2E4\uB978 \uC774\uB3C4 \uB9C8\uC74C\uC744 \uB2E4\uD574 \uB3C4\uC6B8 \uAC83\uC774\uB2E4. \uADF8\uB4E4\uC5D0\uAC8C\uB294 \uADF8\uB4E4\uC758 \uC9C1\uC5C5\uC724\uB9AC\uAC00 \uC788\uAE30 \uB54C\uBB38\uC774\uB2E4.",
