    "text" : "\uD639\uC2DC\uB098 \uC81C\uAC00 \uC800 \uB2E8\uC5B4\uB4E4\uC744 \uC0AC\uC6A9\uD558\uC9C0 \uC54A\uC558\uB2E4\uBA74, \uBA38\uB9BF\uC18D\uC5D0\uC11C '\uC131\uD5A5\uC740 \uC874\uC911\uD558\uC9C0\uB9CC \uC804 \uADF8\uCABD\uC740 \uC544\uB2C8\uB2C8\uAE4C\uC694'\uB77C\uB294 \uBB38\uC7A5\uC744 \uC0DD\uAC01\uD55C \uD6C4, \uC774\uC57C\uAE30\uD558\uB294 \uACFC\uC815\uC5D0\uC11C \uB2E4\uB974\uAC8C \uB9D0\uC774 \uB098\uAC04\uAC78\uAC70\uC5D0\uC694. \uC5B4\uB290\uCABD\uC774 \uB418\uC5C8\uB4E0, \uC758\uBBF8\uB294 \uD06C\uAC8C \uB2E4\uB974\uC9C0 \uC54A\uB2E4\uACE0 \uBD05\uB2C8\uB2E4.\n\uC800\uC758 \uC0DD\uAC01\uC740 \uAC19\uC2B5\uB2C8\uB2E4.",
